  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fort Peck NWR
  outlines Refuge accomplishments from September through December of 1943. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, predators,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments and plantings. The public relations section of the report
  describes recreational uses, hunting, and fishing. N-R forms, maps, and photographs
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
